import { jsx as C } from "react/jsx-runtime";
const I = "data:image/png;base64,", E = ({
  className: g,
  ...A
}) => /* @__PURE__ */ C(
  "img",
  {
    ...A,
    alt: "pdf",
    src: I
  }
);
export {
  E as LightPdfIcon
};
